        (> k (count s)) #{}
	    :else (set (concat
                    (F k (rest s))
                    (map #(conj % (first s)) (F (dec k) (rest s)))))))

(fn combo [n s]
  (cond
    (> n (count s)) #{}
    (= 0 n) #{#{}}
    (empty? s) #{#{}}
    :else (set
           (apply concat
                  (for [x s]
                    (map #(conj % x) (combo (dec n) (disj s x))))))))

(fn kcomb [n s]
  (cond
    (> n (count s)) #{}
    (= n 0) #{}
    (= n 1) (set (map (partial conj #{}) s))
    :else (set (apply clojure.set/union (map (fn [x] (map (fn [y] (conj y x)) (kcomb (dec n) (disj s x)))) s)))))

(fn [size myset]
  (let
    [
     powerSet
     (fn [myset]
       (reduce
        (fn
          [prev item]
          (set (concat prev (for [x prev y item] (conj x y))))
          )
        #{#{}}
        (replicate (count myset) myset)
        )
       )
     ]
    (set (filter #(= size (count %)) (powerSet myset)))
    )
  )

(fn k-combinations [k s]
  (cond
   (= k 0) #{#{}}
   (= k (count s)) #{(set s)}
   (> k (count s)) #{}
   :else (clojure.set/union (k-combinations k (rest s))
                            (set (map #(conj % (first s))
                                      (k-combinations (dec k) (rest s)))))))

(fn k-comb [n set1]
  (cond
    (= n 0) #{}
    (= n 1) (set (map #(hash-set %) set1))
    (> n (count set1)) #{}
    (= n (count set1)) #{set1}
    :else   (let [x (first set1)]
              (clojure.set/union
                (set (map #(clojure.set/union % #{x}) (k-comb (dec n) (disj set1 x))))
                (k-comb n (disj set1 x))))))

(fn k-combinations [k s]
  (cond (zero? k) #{#{}}
        (> k (count s)) #{}
        :else (into #{}
                    (for [comb (k-combinations (dec k) s)
                          v s
                          :when (not (comb v))]
                      (conj comb v)))))
